import { Link } from "react-router-dom";
import { useContext } from "react";
import UserContext from "../utils/UserContext";

export const Home = () => {
  const { user, setUser } = useContext(UserContext);

  return (
    <div>
      <h2>Home</h2>
      <div> {!user ? "You are not logged in." : "Hi  { user } "} </div>
      <br />
      <Link to="/login">
        <button>Login</button>
      </Link>
    </div>
  );
};
